import React from 'react';
import axios from 'axios';

const User = ({users}) => (
  <div>
    <ul>
      { users.map( user => (
          <li key={user.name}>
            {user.name}
          </li>
      )) }
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const response = await axios.get(
    'https://api.github.com/orgs/rocketseat/members'
    );

  return { users: response.data };
}

export default User;
